import React from 'react';
import './App.css';
import { Squash as Hamburger } from 'hamburger-react'
import Navbar from './components/navigation';
import './components/text_animation';
import AnimateText from './components/text_animation';
import CircleAnimation from './components/shapes';
import { SvgAnimation } from './components/shapes';
import { LineAnimation } from './components/shapes';

function App() {
  return (
    <div className="App">

    <Hamburger size={20} color="#FFF" onToggle={toggled => {
      if (toggled) {
        <LineAnimation x1="25%" y1="0%" x2="75%" y2="100%"/>
      } else {
        // close a menu
      }
    }} />

      <header className="App-header">
        <div className="line-container">      
          <LineAnimation x1="0%" y1="25%" x2="100%" y2="25%"/>
        </div>
        <div className="line-container">      
          <LineAnimation x1="100%" y1="75%" x2="0%" y2="75%"/>
        </div>

        <strong class="header-introduction"><AnimateText/></strong>
        <p class='header-information'>CS undergraduate @ <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.gatech.edu/">
            <strong>Georgia Tech</strong>
            </a>
        </p>
        <Navbar/>
      </header>
      <body>
        <SvgAnimation/>
      </body>

    </div> 
  );
}


export default App;
